question:
Given the right triangles ABC and ABD, what is the length of segment BC, in units? [asy]
size(150);
pair A, B, C, D, X;
A=(0,0);
B=(0,12);
C=(-16,0);
D=(-35,0);
draw(A--B--D--A);
draw(B--C);
draw((0,1.5)--(-1.5,1.5)--(-1.5,0));
label("$37$", (B+D)/2, NW);
label("$19$", (C+D)/2, S);
label("$16$", (A+C)/2, S);
label("A", A, SE);
label("B", B, NE);
label("D", D, SW);
label("C", C, S);
[/asy]

answer:
Looking at triangle $ABD$, we can calculate $AB$ through the Pythagorean Theorem. \begin{align*}
AB&=\sqrt{37^2-(19+16)^2}\\
&=\sqrt{37^2-35^2}\\
&=\sqrt{(37+35)(37-35)}\\
&=\sqrt{72 \cdot 2}\\
&=\sqrt{36 \cdot 4}=6 \cdot 2=12\end{align*} Using Pythagorean theorem again to find $BC$, we get \begin{align*}
BC&=\sqrt{12^2+16^2}\\
&=\sqrt{4^2(3^2+4^2)}\\
&=4\sqrt{9+16}\\
&=4\sqrt{25}=4 \cdot 5=\boxed{20} \text{ units}.\end{align*}

Simplify, remembering the exponents take priority over multiplication and multiplication takes priority over addition or subtraction. \begin{align*}
5^3-3\times 5^2+3\times5-1&=125-3\times25+15-1 \\
&=125-75+14 \\
&= 50+14 \\
&= \boxed{64}.
\end{align*}

question:
In the diagram, $AB$ is parallel to $DC,$ and $ACE$ is a straight line. What is the value of $x?$ [asy]
draw((0,0)--(-.5,5)--(8,5)--(6.5,0)--cycle);
draw((-.5,5)--(8.5,-10/7));
label("$A$",(-.5,5),W);
label("$B$",(8,5),E);
label("$C$",(6.5,0),S);
label("$D$",(0,0),SW);
label("$E$",(8.5,-10/7),S);
draw((2,0)--(3,0),Arrow);
draw((3,0)--(4,0),Arrow);
draw((2,5)--(3,5),Arrow);
label("$x^\circ$",(0.1,4));
draw((3,5)--(4,5),Arrow);
label("$115^\circ$",(0,0),NE);
label("$75^\circ$",(8,5),SW);
label("$105^\circ$",(6.5,0),E);
[/asy]

answer:
Since $\angle ACE$ is a straight angle, $$\angle ACB=180^{\circ}-105^{\circ}=75^{\circ}.$$In $\triangle ABC,$ \begin{align*}
\angle BAC &= 180^{\circ}-\angle ABC - \angle ACB \\
&= 180^{\circ}-75^{\circ}-75^{\circ} \\
&= 30^{\circ}.
\end{align*}Since $AB$ is parallel to $DC,$ we have $$\angle ACD = \angle BAC = 30^{\circ}$$due to alternate angles. In $\triangle ADC,$ \begin{align*}
\angle DAC &= 180^{\circ}-\angle ADC - \angle ACD \\
&= 180^{\circ}-115^{\circ}-30^{\circ} \\
&= 35^{\circ}.
\end{align*}Thus, the value of $x$ is $\boxed{35}.$ [asy]
